  input: TEXT,F3A,,"In response to your letter, please note that we have contacted
    the donor in question and learned that donor intent had been to make the first
    contribution in March 2003 designated to General Election 2002 debt retirement.
    The second contribution received by the committee was intended for Primary Election
    2004.  The final contribution in May 2004 was intended for General Election 2004.  We
    have amended the April Quarterly 2003 report to reflect the donor's intent, the
    April Quarterly 2004 to reflect the donors intent, and the donor will amend the
    April Quarterly 2003 to show the same.  Since the election designation was not
    clear at the time of the receipt, incorrect assumptions were made by the Committee.  When
    the final contribution was recieved donor intent for the prior contributions was
    clear, but the amendment had not yet been filed.  Additionally, Column B figures
    as amended accurately reflect prior reports calculated together with current activity
    here listed.  Please contact me with any further questions.  Thank you."
